import  React  from "react";
import  ReactDOM  from "react-dom";
import CommentLoader from "./content.js";
import Aprvcrd from "./new.js";
const App = () => {
    const array = ["hii",'lul','lol'];
    return (
        <div>
            <Aprvcrd><CommentLoader names={array[0]} time='00;00' /></Aprvcrd>
            <CommentLoader names={array[1]} time="10:11" />
            <CommentLoader names={array[2]} time="11:11" />
        </div>
    );
}

ReactDOM.render(
    <App />,
    document.querySelector('#root')
)
